const products = [ ];
const columns = [{
  dataField: 'id',
  text: 'Product ID'
}, {
  dataField: 'name',
  text: 'Product Name'
}, {
  dataField: 'price',
  text: 'Product Price'
}];
 
class ExposedFunctionTable extends React.Component {

    render(){
    return(
    <BootstrapTable keyField='id' data={ products } columns={ columns } />
    )
    }
}
